import React from 'react';
import {Card} from '../Styles/Styles'

export const LocationCard = (props) => {
    const loc = props.item
    console.log(loc)
    return (

        <Card>
              <h3>Name: {loc.name}</h3>
              <h4>Type: {loc.type}</h4>
              <h4>Dimension: {loc.dimension}</h4>
        </Card>

    )
}
